void Draw_Gui(){
	int t = GL_TEXTURE_2D; int r = GL_RGB; int u = GL_UNSIGNED_BYTE;
	
	Move_Pal_Tile_Selection();
	
	glLoadIdentity();
	glTranslatef(0,0,0);
	glScalef(map_scale,map_scale,1);

	glBindTexture(t, texture_gui0);
	
	unsigned char dec;
	unsigned char tile = buffer_tiles[0];
	unsigned char b = buffer_bgcolor[0]; 
	unsigned char f = buffer_fgcolor[0]; 
	
	//Draw palette number
	glTexSubImage2D(t,0,144,168,16,16,r,u,&char_p[b*768]);
	glTexSubImage2D(t,0,160,168,16,16,r,u,&char_p[f*768]);
	
	//Draw tile number
	dec = tile % 10; tile /=10; glTexSubImage2D(t,0,136+32,208,16,16,r,u,&char_p[dec*768]);
	dec = tile % 10; tile /=10; glTexSubImage2D(t,0,136+16,208,16,16,r,u,&char_p[dec*768]);
	dec = tile;                 glTexSubImage2D(t,0,136+ 0,208,16,16,r,u,&char_p[dec*768]);
	
	//Draw tile pos
	dec = tile_X % 10; tile_X /=10; glTexSubImage2D(t,0,208+32,160,16,16,r,u,&char_p[dec*768]);
	dec = tile_X % 10; tile_X /=10; glTexSubImage2D(t,0,208+16,160,16,16,r,u,&char_p[dec*768]);
	dec = tile_X;                   glTexSubImage2D(t,0,208+ 0,160,16,16,r,u,&char_p[dec*768]);
	dec = tile_Y % 10; tile_Y /=10; glTexSubImage2D(t,0,208+32,184,16,16,r,u,&char_p[dec*768]);
	dec = tile_Y % 10; tile_Y /=10; glTexSubImage2D(t,0,208+16,184,16,16,r,u,&char_p[dec*768]);
	dec = tile_Y;                   glTexSubImage2D(t,0,208+ 0,184,16,16,r,u,&char_p[dec*768]);
	
	//Draw gui
	glColor3f( 1.0, 1.0, 1.0 );
	glVertexPointer(3, GL_SHORT, sizeof(Vertex3s), gui_vertices.pos);
	glTexCoordPointer(2, GL_FLOAT, sizeof(TexCoord2f), gui_vertices.coord);
	glColorPointer(3,GL_UNSIGNED_BYTE, sizeof(Color3b), gui_vertices.col);
	glDrawArrays(GL_QUADS, 0, 4*24);
}

void display(){
	glClearColor(0.25f, 0.25f, 0.25f, 0.f);
	glClear( GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT );
	
	glMatrixMode(GL_PROJECTION);
	glLoadIdentity();

	glOrtho(0,SCREEN_WIDTH,SCREEN_HEIGHT,0, 0, 1);
	glScalef(gui_scale,gui_scale,1);
	
	glMatrixMode(GL_MODELVIEW);
	Draw_Map();
	Draw_Gui();
	Draw_Select();
	Edit_Tiles();
	
	glutSwapBuffers();
}

void OpenGl_Init( int argc, char *argv[] ){
	glutInit( &argc, argv );
	//Initialize window system
	glutInitDisplayMode( GLUT_DOUBLE | GLUT_RGB );
	glutInitWindowSize(SCREEN_WIDTH,SCREEN_HEIGHT);
	glutCreateWindow("VGA MAP EDITOR");
	//glutFullScreen();
	glEnable(GL_BLEND);
	glBlendFunc(GL_SRC_ALPHA,GL_ONE_MINUS_SRC_ALPHA); // = color * alpha + background * (1-alpha)
	//glEnable(GL_ALPHA_TEST);
	//glAlphaFunc(GL_NOTEQUAL, 0);
	glEnable(GL_TEXTURE_2D);
	glEnableClientState(GL_VERTEX_ARRAY);
	glEnableClientState(GL_TEXTURE_COORD_ARRAY);
	glEnableClientState(GL_COLOR_ARRAY);
	glScissor(0,0,SCREEN_WIDTH,SCREEN_HEIGHT); 
	glViewport(0,0,SCREEN_WIDTH,SCREEN_HEIGHT);
	
	glGenTextures(1,&texture_gui0);
	glGenTextures(1,&texture_tiles);
	
	glBindTexture(GL_TEXTURE_2D, texture_gui0);
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_WRAP_S, GL_CLAMP);
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_WRAP_T, GL_CLAMP);
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST);
	glTexParameteri(GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST);
	
	glTexImage2D(GL_TEXTURE_2D, 0, GL_RGBA,256,256, 0, GL_RGBA, GL_UNSIGNED_BYTE, gui_pixels);
}

