//CONTROLS
void mouse_click(int button,int state,int x,int y){
	//Controls
	switch(button){
		case GLUT_LEFT_BUTTON:
			if(state==GLUT_DOWN){
				if (mouse_x > 256){
					Set_Tile = 1;
				} else {
					//set bg pal
					if ((mouse_x>16)&&(mouse_x<239)&&(mouse_y>296 )&&(mouse_y<343)){
						buffer_bgcolor[0] = (((mouse_y-296)/24)*8)+((mouse_x-16)/28);
					}
					//select tile
					if ((mouse_y>32)&&(mouse_y<256+32)){
						buffer_tiles[0] = (((mouse_y-32)>>4)*16)+(mouse_x>>4);
					}
				}
			}
			if(state==GLUT_UP){
				Set_Tile = 0;
				if ((mouse_x>7)&&(mouse_x<40)&&(mouse_y>359)&&(mouse_y<392))Load_Map();
				if ((mouse_x>7)&&(mouse_x<40)&&(mouse_y>399)&&(mouse_y<432))Load_Tileset();
				if ((mouse_x>47)&&(mouse_x<80)&&(mouse_y>359)&&(mouse_y<392))Save_Map();
			}
		break;
		case GLUT_MIDDLE_BUTTON:
			if(state==GLUT_DOWN){Grab_Map = 1;sx0 = x; sy0 = y; sx0/=gui_scale; sy0/=gui_scale;sx1 = x/gui_scale;sy1 = y/gui_scale;}
			if(state==GLUT_UP  ){Grab_Map = 0;SCR_X=SCR_X+sx1-sx0;SCR_Y=SCR_Y+sy1-sy0;sx0=0;sy0=0;sx1=0;sy1=0;}
		break;
		case GLUT_RIGHT_BUTTON:
			if(state==GLUT_DOWN){
				if (mouse_x > 256){
					Get_Tile = 1;
				} else {
					//set fg pal
					if ((mouse_x>16)&&(mouse_x<239)&&(mouse_y>296 )&&(mouse_y<343)){
						buffer_fgcolor[0] = (((mouse_y-296)/24)*8)+((mouse_x-16)/28);
					}
				}
			}
			if(state==GLUT_UP){
				//Exit get tile mode and get tiles or group of tiles
				Get_Tile = 0;
				Create_OpenGL_Quad(&select_vertices,0,0,0,0,8,8,0,0,1,1);
			}
		break;
		default:
		break;
	}
}

void SpecialKeys(int key, int x, int y) {
	switch(key) {
		case GLUT_KEY_DOWN :
			if (map_scale<0.5) {
				map_scale*=2;
				gui_scale/=2;
				if (gui_scale == 2) {SCR_X += 128;SCR_Y+=128;}
				if (gui_scale == 4) {SCR_X += 64 ;SCR_Y+=64; }
			}
		break;
		case GLUT_KEY_UP :
			if (map_scale>0.25) {
				map_scale/=2;
				gui_scale*=2;
				if (gui_scale == 2) {SCR_X -= 256;SCR_Y-=256;}
				if (gui_scale == 4) {SCR_X -= 128;SCR_Y-=128;}
				if (gui_scale == 8) {SCR_X -= 64 ;SCR_Y-=64; }
			}
		break;
	}
}

void NormalKeys(unsigned char key, int x, int y) {
	switch(key) {
		case 27:
			exit(1);
		break;
	}
}

void mouse_drag(int x, int y){
	if (Grab_Map){
		sx1 = x/gui_scale;
		sy1 = y/gui_scale;
	}
	
	mouse_x=x; mouse_y=y;
}

void mouse_pos(int x,int y) {
    mouse_x=x; mouse_y=y;
}



